package check

import (
	"testing"
	"os"
	"fmt"
	"github.com/golang/protobuf/proto"
	cb "github.com/hyperledger/fabric/protos/common"
	"encoding/json"
	protosutils "github.com/hyperledger/fabric/protos/utils"
)



func setup() {
	fmt.Println("Start tests...")
}

func shutdown(){
	fmt.Println("Stop tests...")
}

func TestMain(m *testing.M) {
	setup()
	DisplayTransactionPayload()
	code := m.Run()
	shutdown()
	os.Exit(code)
}


func TestTransaction(t *testing.T) {
	payload := &cb.Payload{}
	ExtractProto(bytesPayloadtransaction1, payload, t)

	channelHeader := &cb.ChannelHeader{}
	ExtractProto(payload.Header.ChannelHeader, channelHeader, t)
	DisplayStruct(channelHeader, t)
	//signatureHeader := &cb.SignatureHeader{}
	//ExtractProto(payload.Header.SignatureHeader, signatureHeader, t)
	signatureHeader, _ := protosutils.GetSignatureHeader(payload.Header.SignatureHeader)
	DisplayStruct(signatureHeader, t)
	t.Log("zzzzzzzzzzzzzzzzzzzzzzz")
	ccPayload, _ := protosutils.GetChaincodeProposalPayload(payload.Data)
	DisplayStruct(ccPayload, t)
	t.Log("eeeeeeeeeeeeeeeeeeeeeee")

	displayData(payload.Data)
}

func TestBlock(t *testing.T) {
	blockData := &cb.BlockData{}
	ExtractProto(bytesDataBlock1[0], blockData, t)
	enveloppe := &cb.Envelope{}
	ExtractProto(blockData.Data[0], enveloppe, t)
	payload := &cb.Payload{}
	ExtractProto(enveloppe.Payload, payload, t)


}


func ExtractProto (rawBytes []byte, enveloppe proto.Message, t *testing.T) {
	if err := proto.Unmarshal(rawBytes, enveloppe); err != nil {
		t.Error(err)
	}
}

func DisplayStruct (str interface{}, t *testing.T){
	jsonObject, err := json.MarshalIndent(str, "", "   ")
	if err != nil {
		t.Error(err)
	}
	t.Log(string(jsonObject))
}


func DisplayBlockData(){
	for _, bl := range bytesDataBlock1{
		displayData(bl)
	}
}

func displayData(bl []byte){
	for _, b := range bl  {
		if b >= 32 && b <= 126 {
			fmt.Print(string(b))
			continue
		}
		if b == 10 {
			fmt.Print(string(b))
		} else {
			fmt.Print("[", b, "]")
		}
	}
}

func displayTestData(bl []byte, t *testing.T){
	for _, b := range bl  {
		if b >= 32 && b <= 126 {
			t.Log(string(b))
			continue
		}
		if b == 10 {
			t.Log(string(b))
		} else {
			t.Log("[", b, "]")
		}
	}
}


func DisplayBlockMetadata(){
	for _, bl := range bytesMetadataBlock1{
		displayData(bl)
	}
}

func DisplayTransactionPayload(){
	displayData(bytesPayloadtransaction1)
}

